import React from 'react';
import * as Icon from 'react-feather'

import { Container, FileInfo, Preview } from './styles';

const FileList = () => (
  <Container>
    <li>
      <FileInfo>
        <Preview src="https://images.unsplash.com/photo-1494976388531-d1058494cdd8?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1050&q=80"/>
        <div>
          <button onClick={() => {}}><Icon.XCircle /></button>
        </div>
      </FileInfo>
    </li>
  </Container>
)

export default FileList;
